import StoreShop from "./StoreShop";
import './App.css'
import "./responsive.css"
import {Routes, Route , Link} from "react-router-dom"
import Product from "./navbar/page/Product";
import Home from "./navbar/page/Home";
import Cart from "./navbar/page/Cart";
import Blog from "./navbar/page/Blog";
import Contact from "./navbar/page/Contact";
import Error from "./navbar/page/404";
import Page from "./navbar/page/page";


function App() {
  return (
    <main>
      <div className="grid wide">
        <nav>
          <StoreShop />
          <Page />
        </nav>
        <div className="">
        <Routes>
          <Route path="/home" element = {<Home />}></Route>
          <Route path="/product" element = {<Product/>}></Route>
          <Route path="/cart" element = {<Cart />}></Route>
          <Route path="/blog" element = {<Blog />}></Route>
          <Route path="/contact" element = {<Contact />}></Route>
          <Route path="/404" element = {<Error/>}></Route>
        </Routes>
        </div>
      </div>
    </main>
  );
}

export default App;
